import React from 'react';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';
import 'tailwindcss/tailwind.css';

const ProjectRacc = () => {
  const navigate = useNavigate();

  const features = [
    "Real-time Raccoon Tracking",
    "Educational Resources on Raccoon Safety",
    "Community Engagement Platform",
    "Enhanced Visuals and Interactivity",
    "Seamless User Experience"
  ];

  const techStack = [
    { name: "React", description: "Component-based UI for interactive experiences." },
    { name: "Tailwind CSS", description: "Utility-first CSS for responsive and modern design." },
    { name: "Node.js", description: "Backend runtime for efficient server-side logic." },
    { name: "MongoDB", description: "Scalable and flexible NoSQL database." }
  ];

  return (
    <div className="bg-gray-900 text-gray-100 min-h-screen py-12 px-4 sm:px-8">
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        className="max-w-4xl mx-auto"
      >
        <h1 className="text-4xl font-extrabold text-center text-indigo-500">RaccTracc</h1>
        <p className="mt-6 text-lg leading-relaxed text-center">
          Discover the world of raccoons at UCSD! RaccTracc enhances your raccoon-watching experience with real-time tracking, 
          educational resources, and a vibrant community of enthusiasts. Join us to celebrate these fascinating creatures.
        </p>

        <div className="mt-12 text-center">
          <motion.button
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.95 }}
            onClick={() => navigate(-1)}
            className="px-6 py-3 bg-gray-800 text-gray-300 rounded-full shadow-lg hover:bg-gray-700 focus:outline-none"
          >
            Back to Projects
          </motion.button>
        </div>
      </motion.div>
    </div>
  );
};

export default ProjectRacc;
